Scalar Types A scalar type represents a single value. Rust has four primary scalar types: integers, floating-point numbers, Booleans, and characters. Compound Types Compound types can group multiple values into one type. Rust has two primitive compound types: tuples and arrays. The Tuple Type A tuple is a general way of grouping together a number of values with a variety of types into one compound type. Tuples have a fixed length: once declared, they cannot grow or shrink in size. fn main() { let tup: (i32, f64, u8) = (500, 6.4, 1);
} To extract tuple values fn main() { let tup = (500, 6.4, 1); let (x, y, z) = tup; println!("The value of y is: {}", y);
} We can access a tuple element directly by using a period (.) fn main() { let x: (i32, f64, u8) = (500, 6.4, 1); let five_hundred = x.0; let six_point_four = x.1; let one = x.2;
} The Array Type Another way to have a collection of multiple values is with an array. Unlike a tuple, every element of an array must have the same type. Arrays in Rust are different from arrays in some other languages because arrays in Rust have a fixed length, like tuples. fn main() { let a = [1, 2, 3, 4, 5]; //or let a: [i32; 5] = [1, 2, 3, 4, 5];
} An array isn’t as flexible as the vector type, though. A vector is a similar collection type provided by the standard library that is allowed to grow or shrink in size. Array are stack allocated and can not grow or shrink, where as a vector is heap allocated and thus can grow or shrink. An example of when you might want to use an array rather than a vector is in a program that needs to know the names of the months of the year. It’s very unlikely that such a program will need to add or remove months, so you can use an array because you know it will always contain 12 elements. Accessing Array Elements fn main() { let a = [1, 2, 3, 4, 5]; let first = a[0]; let second = a[1];
}
